import React from 'react';

import TimerSessionViewDate from '../TimerSessionViewDate';

class TimerSessionsView extends React.Component {

  renderTimeSessions() {
    if (Object.keys(this.props.selectedDate).length === 0) { return this.renderAllTimeSessions(); }
    else if (this.props.selectedDate.year !== undefined && this.props.selectedDate.month !== undefined) {
      return this.renderFilteredTimeSessions(this.props.selectedDate);
    }
  }

  renderFilteredTimeSessions(date) {
    if (date.month)
    console.log(date.month);
    console.log(date.day);
  }

  renderAllTimeSessions() {
    return this.props.sessions.map((session, key) => {
      return(
        <div key={key}>
          {session.name} - {session.time} - {session.createdAt}
        </div>
      )
    })
  }

  render() {
    console.log(this.props.selectedDate);
    return(
      <div>
        <TimerSessionViewDate onSelectedDate={this.props.onSelectedDate.bind(this)} />
        { this.props.sessions && this.renderTimeSessions() }
      </div>
    )
  }

}

export default TimerSessionsView
